                basePath = (basePath || '').toLowerCase();
                var pathNameInLowerCase = (window.location.pathname || '').toLowerCase();
                if( pathNameInLowerCase === basePath
                    || 0 === pathNameInLowerCase.indexOf(basePath + '/')) {
                    return true;
                }

                return basePath === (localStorage.getItem('orbit_location_override_base') || '').toLowerCase();
            } catch(err) {
                console.error('isMiniOrbit function failed', err);
                return false;
            }
        };

        var isCip = function() {
            return isMiniOrbit('/cip');
        }

        var isCis = function() {
            return isMiniOrbit('/cis');
        }

        var isProgressiveWebApp = function() {
            // PWA setting is "display": "fullscreen"
            // but installed on desktop it's detected as "standalone" if app is not in fullscreen mode or "fullscreen" if user enters fullscreen mode
            return window.matchMedia('(display-mode: fullscreen)').matches || window.matchMedia('(display-mode: standalone)').matches;
        }

        var showOrbitSplash = function() {
            try {
                var brandID = $allConfigs.brandId;
                var subBrandID = $allConfigs.subBrandId;
                var server = $allConfigs.orbit.extraProperties.paths.server;

                window.splashStart = performance.now();
                logToElastic("[Technical-event]", "SHOW_ORBIT_SPLASH");
                var splashElement = document.createElement('div');
                splashElement.id = 'splash-page';
                var brandElement = document.createElement('div');
                brandElement.className = 'splash-brand';

                if(isCip()){
                    brandElement.style['background-image'] = 'url(' + server + '/assets/images/splash_page_logo-cip8.png)';
                } else {
                    brandElement.style['background-image'] = 'url(' + server + '/assets/images/splash_page_logo-' + brandID + '-' + subBrandID + '.png)';
                }

                brandElement.style['background-repeat'] = 'no-repeat';

                splashElement.appendChild(brandElement);
                document.body.appendChild(splashElement);
            } catch (error) {
                console.error('ERROR IN GETTING ORBIT SPLASH(brandID:' + brandID + ', subBrandID: ' + subBrandID + '): ' + error);
            }
        };

        var loadClientDataFromUrl = function() {
            if(window.location.hash.indexOf('clientData') === -1) {
                return;
            }

            var clientDataSTR = window.location.hash.slice(1).replace('clientData=', '');
            var httpPattern = /^((http|https):\/\/)/;
            if(httpPattern.test(clientDataSTR)) {
                storage.setItem('888-launcher-url', clientDataSTR);
            }
            else{
                var clientData = JSON.parse(decodeURIComponent(clientDataSTR));
                var cgpClient = (localStorage.cgp_client) ? JSON.parse(localStorage.cgp_client) : {};
                cgpClient.clientData = clientData;
                localStorage.setItem('cgp_client', JSON.stringify(cgpClient));
            }
            history.replaceState("", document.title, window.location.pathname + window.location.search); // clear hash from url
        };

        var getClientData = function() {
            var cgpClient = localStorage.getItem('cgp_client');
            if (cgpClient) {
                try {
                    cgpClient = JSON.parse(cgpClient);
                    return cgpClient.clientData;
                } catch (err) {
                    console.log('Failed to parse cgp_client from local storage! Error details: ' + JSON.stringify(err) )
                    return null;
                };
            }else{
                return null;
            }
        };

        var applyOrbitPathsOverrides = function(clientData) {

            if(clientData.orbit && clientData.orbit.server) {
                $allConfigs.orbit.extraProperties.paths.server = clientData.orbit.server;
            }
        };

        var applySdkPathsOverrides = function(clientData) {
            var originalPaths = $allConfigs.sdk.extraProperties.paths;
            var sdkOverrides = clientData.sdk;
            if(sdkOverrides && sdkOverrides.server) {
                originalPaths.server = clientData.sdk.server;
            }
        };

        var getFilesPaths = function() {
            var clientData = getClientData();
            if(clientData) {
                applySdkPathsOverrides(clientData);
                applyOrbitPathsOverrides(clientData);
            }
            return {
                sdk: $allConfigs.sdk.extraProperties.paths,
                orbit: $allConfigs.orbit.extraProperties.paths
            };
        };

        var loadScriptTag = function(id, url) {
            var scriptTag = document.createElement('script');
            scriptTag.id = id;
            scriptTag.src = url;
            document.head.appendChild(scriptTag);
        };

        var loadStyleTag = function(id, url) {
            var styleTag = document.createElement('link');
            styleTag.id = id;
            styleTag['href'] = url;
            styleTag['rel'] = 'stylesheet';
            styleTag['type'] = 'text/css';
            styleTag.onerror = function(err) {
                console.error('Failed to download CSS from ' + url, err);
                if(0 < url.indexOf('/configurations/')) {
                    document.head.removeChild(styleTag);
                    loadStyleTag(id, url.replace('/configurations/', '/configs/'));
                }
            };

            document.head.appendChild(styleTag);
        };

        var loadAppFiles = function() {
            var filesPaths = getFilesPaths();
            loadScriptTag('cgp_loader', filesPaths.sdk.server + filesPaths.sdk.js);
            loadScriptTag('orbit_loader', filesPaths.orbit.server + filesPaths.orbit.js);
            loadStyleTag('orbit_loader_style', filesPaths.orbit.server + filesPaths.orbit.css);
            loadStyleTag('orbit_loader_brand_style', filesPaths.orbit.server + filesPaths.orbit.brandCSS);
            loadStyleTag('cgp_loader_style', filesPaths.sdk.server + filesPaths.sdk.css);
        };

        var logToElastic = function (eventCategory, eventAction, eventLabel, eventValue) {

            try {
                let eventObj = {
                    "eventData": {
                        "event": "CGP_GENERIC_EVENT",
                        "CGPEventCategory": eventCategory,
                        "CGPEventAction": eventAction
                    },
                    "clientData": {
                        "brand" : $allConfigs.brandId,
                        "subBrand" : $allConfigs.subBrandId
                    },
                    "eventHeader": {
                        "level": "information",
                        "target": "casino-orbit"
                    },
                }
                eventLabel && (eventObj.eventData.CGPEventLabel = eventLabel);
                eventValue && (eventObj.eventData.CGPEventValue = eventValue);

                fetch($allConfigs.sdk.config.StructuredLogging.storageUrl, {
                    method: 'POST',
                    mode: 'cors',
                    cache: 'no-cache',
                    credentials: 'same-origin',
                    headers: {
                        'Content-Type': 'application/json'
                    },
                    redirect: 'follow',
                    referrer: 'no-referrer',
                    body: JSON.stringify(eventObj)
                });

            } catch (e) {
                console.error('ERROR WHEN LOGGING ORBIT FALLBACK TO KIBANA FROM INDEX HTML');
            };
        };

        if(isUnsupportedBrowser()){
            return;
        }

        //for PWA we don't want splash screen
        if (!isProgressiveWebApp()) {
            showOrbitSplash();
        }

        loadClientDataFromUrl();
        loadAppFiles();

        var initPWA = function() {
            try {
                var isPWAEnabled = !window.isQAModeEnabled && $allConfigs.orbit.extraProperties.pwaEnabled;
                console.info("PWA isEnabled: " + isPWAEnabled);

                if (!isPWAEnabled) {
                    return;
                }

                var savePwaPrompt = function () {
                    var PWA_PROMPT_EVENT = "pwaPromptEvent";
                    var PWA_PROMPT_CALLBACK = "pwaPromptCallback";
                    var PWA_INSTALLED_CALLBACK = "pwaInstalledCallback";

                    window.addEventListener('beforeinstallprompt', function(e) {
                        console.debug("beforeinstallprompt handler called");
                        // Prevent Chrome 67 and earlier from automatically showing the prompt
                        e.preventDefault();
                        if (window[PWA_PROMPT_CALLBACK]) {
                            // if we have a callback set, call it
                            window[PWA_PROMPT_CALLBACK](e);
                        } else {
                            // stash the event so it can be triggered later
                            window[PWA_PROMPT_EVENT] = e;
                        }
                    });

                    window.addEventListener('appinstalled', function(e) {
                        console.debug("appinstalled handler called");
                        if (window[PWA_INSTALLED_CALLBACK]) {
                            // if we have a callback set, call it
                            window[PWA_INSTALLED_CALLBACK](e);
                        }
                    });
                }

                var addPwaManifest = function() {
                    var linkTag = document.querySelector('link#manifest-placeholder');
                    var pwaPath = $allConfigs.orbit.extraProperties.paths.pwaResources;
                    if (linkTag && pwaPath) {
                        linkTag.href = pwaPath + '/manifest.json';
                    }
                }

                savePwaPrompt();
                addPwaManifest();
            }
            catch (err) {
                console.error('Error in initPWA', err);
            }
        };

        initPWA();
    })();

    </script>
